import React, { useState, useRef, useEffect } from "react";
import { useLocation } from "react-router-dom";
import "./transfer.css";

const TransferForm = () => {
  const location = useLocation();
  const asset = location.state?.asset; // Get asset details from navigation state

const user = JSON.parse(localStorage.getItem("currentUser"));

  const [name, setName] = useState(user?.username || "");
  const [company, setCompany] = useState("");
   const [department, setDepartment] = useState("");
   const [assetUserName, setUserName] = useState("");
   const [assetUpdateDate, setAssetUpdateDate] = useState("");
   const [specialNote, setSpecialNote] = useState("");
   
  const companies = ["Vella", "98 Acers", "Ravana Pool Club", "Flying Ravana", "Le Maas Tota", "Tea Factory","Walaa kulu","kiri kopi"];
  const departments = ["ICT", "HR", "Kitchen", "Front Office", "Store", "Account", "Audit"];

  const generateTrackingId = (serialNumber) => {
    const companyCodes = { Vella: "VE", "98 Acers": "98", "Ravana Pool Club": "RPC", "Flying Ravana": "FR", "Le Maas Tota": "LMT", "Tea Factory": "TF" , "Walaa kulu": "WK","kiri kopi":"KK"};
    const departmentCodes = { ICT: "IT", HR: "HR", Kitchen: "KT", Store: "ST", "Front Office": "FO", Account: "AC", Audit: "AU" };

    const companyCode = companyCodes[company] || "XX";
    const departmentCode = departmentCodes[department] || "XX";
    const serialSuffix = mainCategory === "Electronic items" && serialNumber ? serialNumber.slice(-4) : "";

    




    const randomNum = `${new Date().toISOString().slice(2, 10).replace(/-/g, "").slice(0, 6)}${String(Math.floor(Math.random() * 100)).padStart(2, "0")}`.slice(-5);


    return serialNumber ? `${companyCode}-${departmentCode}-${serialSuffix}` : `${companyCode}-${departmentCode}-${randomNum}`;
  };

  

  return (
    <div className="transfer-container">
      <h2 className="trnshead">Transfer Asset</h2>
      <form className="transfer-form">
        <div className="form-group">
          <label className="l1">Transfer Name:</label>
          <input className="in1" value={name}
            onChange={(e) => setName(e.target.value)}
            placeholder="Enter your Name"
            readOnly={Boolean(user)} />
        </div>

        

        <div className="form-group">
          <label className="l1">Category:</label>
          <input className="in1" type="text" value={asset?.mainCategory || ""} readOnly />
        </div>

        <div className="form-group">
          <label className="l1">Type:</label>
          <input className="in1" type="text" value={asset?.type || ""} readOnly />
        </div>

        <div className="form-group">
          <label className="l1">Asset Name/Brand:</label>
          <input className="in1" type="text" value={asset?.assetName || ""} readOnly />
        </div>

        <div className="form-group">
          <label className="l1">Serial Number:</label>
          <input className="in1" type="text" value={asset?.serialNumber || ""} readOnly />
        </div>

        
        
        <div className="form-group">
          <label className="l1">Model Number:</label>
          <input className="in1" type="text" value={asset?.assetModel || ""} readOnly />
        </div>

        <div className="form-group">

<select value={company} onChange={(e) => setCompany(e.target.value)}>
  <option value="">Select Transfer Company</option>
  {companies.map((com) => (
    <option key={com} value={com}>{com}</option>
  ))}
</select></div>

<div className="form-group">
              <select value={department} onChange={(e) => setDepartment(e.target.value)}>
                <option value="">Select Department</option>
                {departments.map((dep) => (
                  <option key={dep} value={dep}>{dep}</option>
                ))}
              </select>
            </div>   

            <input
                type="text"
                value={assetUserName}
                onChange={(e) => setUserName(e.target.value)}
                placeholder="User Name"
              /> 

<input
            className="dat"
            type="date"
            value={assetUpdateDate}
            onChange={(e) => setAssetUpdateDate(e.target.value)}
          />

<input
            type="text"
            value={specialNote}
            onChange={(e) => setSpecialNote(e.target.value)}
            placeholder="Enter Special Note (Optional)"
          />

        <button type="submit" className="transfer-button">Transfer</button>
        
      </form>
    </div>
  );
};

export default TransferForm;
